  // const removeTour = (id) => {
  //   const newTour = tour.filter((tour) => tour.id !== id)
  //   setTour(newTour);
  // } 

  if(tour.length === 0) {
   return(
    <div>
      <h2>No data found</h2>
      <button>Refresh</button>
    </div>
   )
  }
  return (
    <div className="App">
      <h3>Tour Project</h3>
      <Card tour={tour} setTour={setTour} />
    </div>
  );
}

export default App;
